function Digit({ value }) {
    return <button>{value}</button>
}

export default function Calculator() {
    return (
        <>
            <input type="text" />
            <div class="board-row">
                <Digit class="square" value={1}></Digit>
                <Digit value={2}></Digit>
                <Digit value={3}></Digit>
            </div>
        </>
    );
}
